const PlayfairDisplayScRegular = `@font-face { font-family: 'Playfair Display SC'; font-style: normal; font-weight: 400; src: local('Playfair Display SC Regular'), local('PlayfairDisplaySC-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const PlayfairDisplayScItalic = `@font-face { font-family: 'Playfair Display SC'; font-style: italic; font-weight: 400; src: local('Playfair Display SC Italic'), local('PlayfairDisplaySC-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
