const PlayfairDisplaySc900 = `@font-face { font-family: 'Playfair Display SC'; font-style: normal; font-weight: 900; src: local('Playfair Display SC Black'), local('PlayfairDisplaySC-Black'), url('data:font/woff2;base64,') format('woff2'); }`;
